import React from 'react'
import { Navigate } from 'react-router-dom';
import { Container } from 'reactstrap';

export default function Dashboard() {

  const isAuthenticated = () => {
    return !!localStorage.getItem('token');
  };


  return (
    isAuthenticated()
    ? <Container>

    </Container>
    : <Navigate to='/login' />
  )
}
